Perfect day activity in Mallorca! Save this for ur next trip 🤸🏼‍♀️

@ecovinyassa — only €15 / person, includes a self-guided farm tour (with hilarious chickens 😂) and a snack afterwards with produce from the farm 💖✨ it was wholesome, peaceful and we loved it a lot!! 

then pop over to Fornalutx (did I pronounce correctly 😬?!) which locals told us was one of the most picturesque towns on the whole island. we were not disappointed 🤩🤩🤩
